    @GET('/hello-world')
    public httpHandler() {
        let counter = 0;
        for(let i=0; i<= this.peers.length-1; i++) {
            console.log('iteration: #' + i);
            let peer = BtfsPeer.fromRaw(this.peers[i]);
            console.log(peer);

            this.repo.save(peer);
            counter++;

        }
        console.log('counter: ' + counter);
        return "finish";
    }

    @GET('/hello-world-await')
    public async httpHandlerAwait() {
        let counter = 0;
        for (let i = 0; i <= this.peers.length - 1; i++) {
            console.log('iteration: #' + i);
            let peer = BtfsPeer.fromRaw(this.peers[i]);
            console.log(peer);

            await this.repo.save(peer);
            counter++;

        }
        console.log('counter: ' + counter);
        return "finish";
    }

